SELECT COALESCE("t0"."n_name", "t0"."n_name") AS "n_name", "t0"."s_suppkey", CASE WHEN "t0"."p_size" > 10 THEN "t0"."ps_availqty" ELSE 0 END AS "FD_COL_2", "t0"."p_retailprice", "t0"."p_name", ', ' AS "FD_COL_5", "orders"."o_totalprice"
FROM (SELECT "supplier"."s_suppkey", "supplier"."s_name", "supplier"."s_address", "supplier"."s_nationkey", "supplier"."s_phone", "supplier"."s_acctbal", "supplier"."s_comment", "t"."n_nationkey", "t"."n_name", "t"."n_regionkey", "t"."n_comment", "partsupp"."ps_partkey", "partsupp"."ps_suppkey", "partsupp"."ps_availqty", "partsupp"."ps_supplycost", "partsupp"."ps_comment", "part"."p_partkey", "part"."p_name", "part"."p_mfgr", "part"."p_brand", "part"."p_type", "part"."p_size", "part"."p_container", "part"."p_retailprice", "part"."p_comment", "lineitem"."l_orderkey", "lineitem"."l_partkey", "lineitem"."l_suppkey", "lineitem"."l_linenumber", "lineitem"."l_quantity", "lineitem"."l_extendedprice", "lineitem"."l_discount", "lineitem"."l_tax", "lineitem"."l_returnflag", "lineitem"."l_linestatus", "lineitem"."l_shipdate", "lineitem"."l_commitdate", "lineitem"."l_receiptdate", "lineitem"."l_shipinstruct", "lineitem"."l_shipmode", "lineitem"."l_comment"
FROM "TPCH"."lineitem"
RIGHT JOIN ("TPCH"."partsupp" INNER JOIN ("TPCH"."supplier" INNER JOIN (SELECT *
FROM "TPCH"."nation"
WHERE "n_name" LIKE 'N%') AS "t" ON "supplier"."s_nationkey" = "t"."n_nationkey") ON "partsupp"."ps_suppkey" = "supplier"."s_suppkey" INNER JOIN "TPCH"."part" ON "partsupp"."ps_partkey" = "part"."p_partkey") ON "lineitem"."l_partkey" = "partsupp"."ps_partkey") AS "t0"
LEFT JOIN "TPCH"."orders" ON "t0"."l_orderkey" = "orders"."o_orderkey"